import React, { Component } from 'react';
import { Navbar, Nav } from 'react-bootstrap';

import './Nav.css'
class Navs extends Component {
    render() {
        return (
            <>
                <div className="Navbar">

                    <Navbar 
                        variant="dark" 
                        expand="lg"    
                        // fixed="top"
                    >
                        <Navbar.Brand>
                            Matador MotorSports
                        {/* <img
                            src="/car.svg"
                            width="30"
                            height="30"
                            className="d-inline-block align-top"
                            alt="Matador MotorSports"
                        /> */}
                        </Navbar.Brand>
                    </Navbar>  
                </div>

            </>
        )
    }
}

export default Navs;
